import './App.css';
import React, { Component } from 'react';
import Card from "./Card.js";


class Page extends Component {
    constructor() {
        super();
        this.state = {
            to_do: []
        };
    }

    componentDidMount = () => {
        console.log("Mounted")
        fetch('/api/getToDo')
        .then(res => res.json())
        .then(results => {
            console.log(results)
            this.setState({ to_do: results })
        })
        .catch(error => {
            console.error(error)
        })
    }

    render() {
        return (
            <div>
                <Card />
            </div>
          )
    }
  
}

export default Page;
